    true,nt"url": null,nt"notes": "National Airspace System Resources (NASR)
    maintains the national aeronautical information database, containing static data
    related to NAS facilities and operations.  It is a system made up of many interfaces
    including user interfaces, system interfaces, and product generation interfaces.
     It is often referred to as a database, because it is the official source of the
    data that is used by many of the other AIM systems, Chart Producers (both government
    and commercial), data for adaptation into the operational NAS systems (for example
    the Host/ERAM, and TFMS), as well as other FAA systems.  However, this data is made
    available via one of the interface types listed above or via products generated
    from the system.   Several of the interfaces also support the management of the
    data, whether it is system-to-system or human interfaces to support entry and validation
    prior to dissemination or distribution.",nt"license_title": "Other License
